    s\ar [r, "!"]\ar [d, hook]\ar [dr, phantom, "\lrcorner ", very near start] & *\ar [d, "\top ", hook] \\
    x\ar [r, dashed, "\chi _s"'] & \Omega 
  \end {tikzcd}


 is a pullback.

