    \end {tikzcd}



  commutes. Following 1_x around the top and right, we get       u_*(\eta _x(1_x)) = u_*(t) = ut,    while on the left and bottom we get       \eta _y(u_*(1_x)) = \eta _y(u) = 1_y,   
  so commutativity implies ut = 1_y.

